    return (
        <div>
            <form>
            <form data-forms="floating-label" class="ml-form">
          <fieldset class="ml-form-field">
            <label>
              <input type="text" onkeyup="this.setAttribute('value', this.value);" value=""/>
                <span>Name</span>
                <div class="ml-form-field-errortext">Error message</div>
              </label>
          </fieldset>
        </form>
                    
            </form>
        </div>
    );
}

export default form;
